Date.prototype.Format=function(a){let o={"M+":this.getMonth()+1,"d+":this.getDate(),"h+":this.getHours(),"m+":this.getMinutes(),"s+":this.getSeconds(),"q+":Math.floor((this.getMonth()+3)/3),S:this.getMilliseconds()};if(/(y+)/.test(a)){a=a.replace(RegExp.$1,(this.getFullYear()+"").substr(4-RegExp.$1.length))}for(let k in o){if(new RegExp("("+k+")").test(a)){a=a.replace(RegExp.$1,(RegExp.$1.length===1)?(o[k]):(("00"+o[k]).substr((""+o[k]).length)))}}return a};Date.prototype.add=function(b,a){a*=1;if(isNaN(a)){a=0}let date=new Date(this.getTime());switch(b){case"y":date.setFullYear(date.getFullYear()+a);break;case"M":date.setMonth(date.getMonth()+a);break;case"d":date.setDate(date.getDate()+a);break;case"h":date.setHours(date.getHours()+a);break;case"m":date.setMinutes(date.getMinutes()+a);break;case"s":date.setSeconds(date.getSeconds()+a);break;default:}return date};